FeedPackage.ReleaseNotes:
Operation Syntax: sin(v) cos(v) tan(v) log(v) log10(v) pow(v1,v2) sqrt(v)
Examle: var formula = "(log(pow(a,b)))+(cos(n)*(tan(m)))";
*Now You Can Put Digit Directly To The Formula. For Example: ap.Process("(log10(pow(a,b)))+(cos(60)*(tan(45)))"); ap.Process("log10(pow(a,b)+1)");
For More Info And Sample Please Visit https://github.com/AlirezaP/FormulaEngine.Net.

